■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">両手でダンベルエクササイズ、時には片手だけでエクササイズ。ウエイトは(両手で)3kg～15kg。水の量をコントロールしてトレーニングを楽しみながら鍛えます!!使用する時はお好みの水量で重さを調節できます。水漏れの心配なし!高品質PVC素材採用。水の重さなので金属と違い、落としても負荷が分散!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">33cm×21cm×21cm(水を入れた状態)</font><br><font color="#333333" size="-1">個装サイズ：35×15×14cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約0.81kg(水が入ってない状態)</font><br><font color="#333333" size="-1">個装重量：900g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">PVC、ABS樹脂</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">【プレート(水満タンの時)】<br>　直径：約21cm<br>　厚み：約6.5cm<br>【シャフト】<br>　直径：約2.2～2.9cm<br>　長さ：33cm<br>組立式</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">プレート8個、シャフト2本、プレートストッパー8個、取扱説明書、保証書(6ヶ月)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常より3～6日ほど日数が掛かる場合がございます。・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
